#form {
    width: 60%;
    height: 0%;
    display: flex;
    justify-content: center;
    margin: 5% 45%;
    transform: translateX(-50%);
    overflow: hidden;
    position: absolute;
    z-index: 10;
    opacity: 0;
    background-color: rgba(255, 255, 255, 0.8);
    backdrop-filter: blur(10px);
    border-radius: 20px;
    border: 1px solid black;
    h1 {
        font-size: 120px;
        border-bottom: 1px solid black;
        margin: 4% 0; 
    }
    form {
        height: 86%;
        width: 130%;
        transform: translateX(-12.5%);
        display: flex;
        flex-direction: column;
        justify-content: space-evenly;
        input, select, option {
            border: 0;
            background-color: transparent;
            font-size: 80px;
            color: #636363;
            letter-spacing: 5px;
            padding: 0 30px;
        }
        .input-box {
            border-bottom: 1px solid black;
        }
        input::-webkit-calendar-picker-indicator{
            display: none;
        }
        #form-buttons {
            width: 100%;
            display: flex;
            justify-content: space-evenly;
            input {
                padding: 2% 17%;
                margin: 1% 4% 5%;
                border-radius: 20px;
                border: 1px solid black;
            }
            .submit-btn:hover {
                background: lightgreen;
            }
            .close-btn:hover {
                background: rgb(255, 102, 102);
            }
        }
    }
    .checkmark {
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        width: 0;
        border-radius: 50%;
        display: block;
        stroke-width: 2;
        stroke: lightgreen;
        stroke-miterlimit: 10;
        box-shadow: inset 0px 0px 0px black;
        z-index: 11;
      }
      
      .checkmark__circle {
        stroke-dasharray: 166;
        stroke-dashoffset: 166;
        stroke-width: 2;
        stroke-miterlimit: 10;
        stroke: lightgreen;
        fill: none;
        z-index: 11;
      }
      
      .checkmark__check {
        transform-origin: 50% 50%;
        stroke-dasharray: 48;
        stroke-dashoffset: 48;
        z-index: 11;
      }
}
